import React from "react";
import PropTypes from "prop-types";

const Title = props => {
  return (
    <React.Fragment>
      <div
        style={{ width: "4px", height: "24px", backgroundColor: "white" }}
      ></div>
      <label className="component-label">{props.titleName}</label>
    </React.Fragment>
  );
};

const Featured = props => {
  return (
    <div className="featured">
      <Title titleName="Featured" />
    </div>
  );
};

class Home extends React.Component {
  render() {
    return (
      <div className="home">
        <Featured />
      </div>
    );
  }
}

export default Home;
